import React from "react";
import { SafeAreaView, StyleSheet, Text,Image, TouchableOpacity, View, TextInput } from "react-native";

import { useNavigation } from "@react-navigation/native";






export default function Login() {
    const navigation = useNavigation()

    return (
        <SafeAreaView style={styles.container}>
           
            <View style={{ flexDirection: "row", justifyContent: 'space-between' }}>
                <TouchableOpacity onPress={() => navigation.navigate("Cadusuario")}>
                    <Text style={styles.tela1}>Mudar de Tela Cadusuario</Text>
                </TouchableOpacity>
                <TouchableOpacity onPress={() => navigation.navigate("Dashiboard")}>
                    <Text style={styles.tela1}>Mudar de Tela Dashiboard</Text>
                </TouchableOpacity>
            </View>
            <View>
            <TextInput placeholder="Email" style={styles.input}>{props.inpu}</TextInput>
           
            </View>
            
          
            

            


        </SafeAreaView>

    );
}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
    },
    tela1: {
            marginTop: 20,
            marginBottom: 5,
            padding: 10,
            borderWidth: 1,
            backgroundColor: "#E0460D",
        },

        Image: {
            fontSize: 40,
            marginTop: 10,
            height: 30,
            padding: 20,
            resizeMode: 'contain',
        },
    })
